function multiplayer2(e) {
  if (e.pageX || e.pageY) {
    x = e.pageX;
    y = e.pageY;
  } else {
    x = e.clientX + document.body.scrollLeft + document.documentElement.scrollLeft;
    y = e.clientY + document.body.scrollTop + document.documentElement.scrollTop;
  }
  x -= canvas.offsetLeft;
  y -= canvas.offsetTop;
  if (x > 260) {
    if (x < 360) {
      if (y > 300) {
        if (y < 350) {
          var server = document.getElementById('server');
          if (server.value != "") {
            document.removeEventListener('click', multiplayer2);
            user.host = new Host();
            user.host.control(server.value);
          } else {
            if (document.getElementById('gamemode').value == 'pvp') {
              document.removeEventListener('click', multiplayer2);
              user.host = new Host();
              user.host.control('pvp');
            }
          }
        }
      }
    }
  }
  if (x > 150) {
    if (x < 250) {
      if (y > 300) {
        if (y < 350) {
          var server = document.getElementById('server');
          if (server.value != "") {
            document.removeEventListener('click', multiplayer2);
            user.joiner = new Joiner();
            user.joiner.control(server.value);
          } else {
            document.removeEventListener('click', multiplayer2);
            user.joiner = new Joiner();
            user.joiner.control('pvp');
          }
        }
      }
    }
  }
  if (x > 60) {
    if (x < 140) {
      if (y > 60) {
        if (y < 90) {
          mainMenu();
        }
      }
    }
  }
}

function wall(x, y, m) {
  if (m) {
    b.push(new Block(0, x, y, true));
  }
  var l = 0;
  while (l < b.length) {
    if (b[l].x == x) {
      if (b[l].y == y) {
        b[l].wall(x, y);
      }
    }
     l++;
  }
  if (Game.level == 'multiplayer-joiner') {
    draw.drawImage(wall_image, x * 50, y * 50);
  }
} // creates a wall
